import {AbsUserApi} from "../abstract/AbsUserApi";
class DubboUserApi extends AbsUserApi{
    getCurrentUserMenu(loading) {
        let data = {};
        return this.request({
            url: `/systemInfoService/loadUserMenu`,
            method: "post",
            loading: loading,
            data: qs.stringify(data),
            baseURL: this.modulePath,
            params: data
        });
    }
}

export {
    DubboUserApi
}
